import React from 'react'

export default function Items({items}) {
    return (
        <div className="items border col-10 d-flex flex-wrap justify-content-evenly p-2">
            {console.log('items render')}
            {items.map((item,i)=>
                <div style={{width:'200px',height:'35vh'}} key={i} className="item my-2 col-4 border rounded d-flex flex-column align-items-center">
                    <img style={{height:'200px'}} src={item.images[0]} alt="" />
                    <p>{item.title}</p>
                </div>
            )}
        </div>
    )
}
